   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_4" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_7", t1."Leaf_9", t1."Leaf_17", t1."Leaf_18", t1."Leaf_23", t1."Leaf_24", t1."Leaf_27", t1."Leaf_29", t1."Leaf_30", t1."Leaf_32", t1."Leaf_34", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_42", t1."Leaf_43", t1."Leaf_44", t1."Leaf_45", t1."Leaf_47", t1."Leaf_48", t1."Leaf_49", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_55", t1."Leaf_56" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_46" > 6.500000) AND (t."X_58" <= 3.500000) AND (t."X_61" <= 6.500000)) THEN 7 ELSE NULL END AS "Leaf_7",
      CASE WHEN((t."X_46" > 6.500000) AND (t."X_58" <= 3.500000) AND (t."X_61" > 6.500000) AND (t."X_51" <= 4.500000)) THEN 9 ELSE NULL END AS "Leaf_9",
      CASE WHEN((t."X_46" <= 6.500000) AND (t."X_60" > 1.500000) AND (t."X_62" > 6.500000) AND (t."X_45" > 2.500000) AND (t."X_52" <= 5.500000)) THEN 17 ELSE NULL END AS "Leaf_17",
      CASE WHEN((t."X_46" <= 6.500000) AND (t."X_60" > 1.500000) AND (t."X_62" > 6.500000) AND (t."X_45" > 2.500000) AND (t."X_52" > 5.500000)) THEN 18 ELSE NULL END AS "Leaf_18",
