   CAST(NULL AS FLOAT) AS "LogProba_6",
   AVG(t."P_6") AS "Proba_6",
   CAST(NULL AS FLOAT) AS "Score_6",
   CAST(NULL AS FLOAT) AS "LogProba_7",
   AVG(t."P_7") AS "Proba_7",
   CAST(NULL AS FLOAT) AS "Score_7",
   CAST(NULL AS FLOAT) AS "LogProba_8",
   AVG(t."P_8") AS "Proba_8",
   CAST(NULL AS FLOAT) AS "Score_8",
   CAST(NULL AS FLOAT) AS "LogProba_9",
   AVG(t."P_9") AS "Proba_9",
   CAST(NULL AS FLOAT) AS "Score_9"
FROM "union_of_trees" AS t
GROUP BY t."index"
),
arg_max_cte_with_max_proba AS 
( SELECT t."index" AS "index",
    t."Proba_0" AS "Proba_0",
